grid = list(list(x) for x in input.splitlines())
output = 0

while True:
    roundSum = 0
    for y in range(len(grid)):
        for x in range(len(grid[y])):
            if grid[y][x] == '@':
                sum = 0
                for k in range(max(y-1,0),min(y+2,len(grid))):
                    for j in range(max(x-1,0),min(x+2,len(grid[0]))):
                        sum += int(not(y == k and x == j) and grid[k][j] == '@')
                if sum < 4:
                    grid[y][x] = '.'
                    roundSum += 1
    if roundSum == 0:
        break
    else:
        output += roundSum
print(output)